textOriginal:
Po que o Bozo será derrotado??
- O maior inimigo do Bozo é ele próprio, principalmente quando abre a bocarra;
- Quando dispara contra o oponente, acerta o próprio pé;
- Seus filhos atiram contra ele na maiorias das vezes;
- Bozo se desacreditou totalmente;
- Bozo mente descaradamente;
- Bozo compra apoios pois não é inteligente nem carismático;
- Bozo prega o ódio e esquece das propostas;
- Campanha do Bozo é burra, age por fake news e é penalizada...
Concordam????.
